import { memo } from 'react'

function BookingDetail() {
    return (
        <div className='space-place-an-order p-0'>
            <div className='d-flex'>
                <div className='section-tour-detail w-75'></div>
                <div className='section-tour-detail w-25'></div>
            </div>
        </div>
    )
}

export default memo(BookingDetail)
